import React from 'react';
import Switch from "./switch";
import VacancyCard from "./vacancyCard";
import OpportunityCard from "./opportunityCard";
import opportunity1 from '../images/startonline-min.png'
import opportunity2 from '../images/BA_JAVA 1200x1200_3_ukr.png'
import deloitte from "../images/deloitte.png"
import procredit from "../images/procredit.png"
import fozzy from "../images/img.png"
import {Sliders} from "react-feather"
import Filters from "./landing/filters";

export default function Vacancies() {

    const vacancies = [
        {id: 1, title: "Менеджер з комунікацій", description: " Задачі: встановлення партнерств, комунікація з клієнтами", company: "Deloitte", logo: deloitte},
        {id: 2, title: 'Менеджер з комунікацій', description: " Задачі: встановлення партнерств, комунікація з клієнтами", company: "Deloitte", logo: procredit},
        {id: 2, title: 'Менеджер з комунікацій', description: " Задачі: встановлення партнерств, комунікація з клієнтами", company: "Deloitte", logo: fozzy}
    ];

    const opportunities = [
        {id: 1, title: "Marketing&Finance Game", company: "Hashtag", image: opportunity1},
        {id: 2, title: 'EY Cyber Consulting Bootcamp', company: "Deloitte", image: opportunity2},
    ];

    return (
        <section className="container-vacancies">
            <Filters/>
            <div className="vacancies-column-width">
                <Switch/>
                    {vacancies.map(function(vacancy, i){
                        return (
                            <VacancyCard
                                key={i}
                                title={vacancy.title}
                                description={vacancy.description}
                                company={vacancy.company}
                                logo={vacancy.logo}
                            />
                        )
                    })}
                {opportunities.map(function(vacancy, i){
                    return (
                        <OpportunityCard
                            key={i}
                            title={vacancy.title}
                            description={vacancy.description}
                            company={vacancy.company}
                            image={vacancy.image}
                        />
                    )
                })}
            </div>
            <div className="vacancies-empty-column"></div>
        </section>
    )
}
